function gainItem(player, itemid, quantity) { //获得物品函数--针对其他栏位无法识别类
    var c = player.getClient();
    if (quantity > 0) {
        //MapleInventoryManipulator.addById(c, itemid, quantity, "");
        var ii = MapleItemInformationProvider.getInstance();
        var item = ii.getEquipById(itemid);
        //var type = ii.getInventoryType(itemid);
        var type = GameConstants.getInventoryType(itemid);
        if (!MapleInventoryManipulator.checkSpace(c, itemid, quantity, "")) {
            var invtype = GameConstants.getInventoryType(itemid);
            c.getSession().write(CField.serverNotice(1, "你的背包已满"));
            return;
        }
        MapleInventoryManipulator.addFromDrop(c, item, false);
    } else {
        MapleInventoryManipulator.removeById(c, GameConstants.getInventoryType(itemid), itemid, -quantity, true, false);
    }
    c.getSession().write(CField.getShowItemGain(itemid, quantity, true));
}